    <div dangerouslySetInnerHTML={{__html:aboutUsInf}}></div>
  </div>
  <ul className=" list-inline text-center pt-5 mt-5 pb-3">
    {MenuItems}
  </ul>
</div>
</> 
);
  }
}

export default Footer;
